import React from "react";

const Footer = () => {
  return (
    <div className="sixteen wide column" style={{ padding: "0px" }}>
      <div className="ui inverted vertical footer segment">
        <div class="ui text container segment inverted">
          <h1>My DIV</h1>
        </div>
      </div>
    </div>
  );
};

export default Footer;
